IF OBJECT_ID('dbo.proc_transform_265', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_265;
GO
CREATE PROCEDURE dbo.proc_transform_265
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_265
    SET payload = LEFT(payload, 1000) + N'|V4-265|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_265;
END
